import {Link} from "react-router-dom";

const ShoesCard = ({shoe}) => {
    console.log(shoe)
    return (
        <li key={shoe.id}>
            <Link to="">
                <img src={`http://localhost:3000/utils/img/${shoe.url_path}`} alt="1"></img>
            </Link>
            <div>{shoe.brand}</div>
            <div>{shoe.model}</div>
            <div>{shoe.price}</div>
            <div>{shoe.rating === 0 ? "Not yet rated" : shoe.rati}</div>
        </li>
    )
}


export default ShoesCard;
